css:
@-moz-document url-prefix("https://osudaily.net") {
body {
    background: #111 !important;
    color: white !important;
}
.profile-div-wrapper {
    margin-bottom: 25px;
    border-radius: 15px;
    background-color: #282828 !important;
    color: white !important;
}
.bodycontainer {
    background-color: #111 !important;
}
.profile-div-title {
    color: white !important;
    font-size: 200%;
    font-style: oblique;
    text-align: center;
    margin: 15px;
}
* {
    font-family:"Exo 2";
    color: white
}

.profile-badgetext {
    text-align: left;
    font-style: italic;
    color: white !important;
}

.profile-desc {
    margin: 0;
    padding: 0;
    color: #4ad !important;
    font-size: 24px;
    font-style: normal;
    line-height: 1.1;
}

.profile-div-wrapper span{
   background-color: #282828 !important;
}

.profile-badgecustom {
    float: left;
    width: 220px;
    height: 234px;
    margin-left: 28px;
    color: #4ad !important;
}

.profile-badge--level span{
    background:#3b94c1 !important;
}

.main-svg{
    width: 663;
}

}
